import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 56-231.48 Applicability of other laws.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-231.48.md","filePath":"vacode/56-231.48.md"}'),o={name:"vacode/56-231.48.md"},i=r('<h1 id="§-56-231-48-applicability-of-other-laws" tabindex="-1">§ 56-231.48 Applicability of other laws. <a class="header-anchor" href="#§-56-231-48-applicability-of-other-laws" aria-label="Permalink to &quot;§ 56-231.48 Applicability of other laws.&quot;">​</a></h1><p>All of the provisions of the Virginia Stock Corporation Act, Chapter 9 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-601/" target="_blank" rel="noreferrer">13.1-601</a> et seq.) of Title 13.1, and the Virginia Nonstock Corporation Act (§ <a href="http://law.lis.virginia.gov/vacode/13.1-801/" target="_blank" rel="noreferrer">13.1-801</a> et seq.), insofar as not inconsistent with this article, are hereby made applicable to stock and nonstock cooperatives, respectively, when the articles of incorporation are filed in the office of the Commission; provided, however, that subsections D through G of § <a href="http://law.lis.virginia.gov/vacode/13.1-620/" target="_blank" rel="noreferrer">13.1-620</a> and subdivision 1 of § <a href="http://law.lis.virginia.gov/vacode/13.1-825/" target="_blank" rel="noreferrer">13.1-825</a> shall not apply to any affiliate or subsidiary of a cooperative. A cooperative must have a registered office and a registered agent, pursuant to § <a href="http://law.lis.virginia.gov/vacode/13.1-634/" target="_blank" rel="noreferrer">13.1-634</a> or § <a href="http://law.lis.virginia.gov/vacode/13.1-833/" target="_blank" rel="noreferrer">13.1-833</a>, as appropriate.</p><p>1999, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0874" target="_blank" rel="noreferrer">874</a>.</p>',3),n=[i];function l(s,c,p,h,f,d){return a(),t("div",null,n)}const g=e(o,[["render",l]]);expo